    <script type="text/javascript">
    function returnwasset(){
            $.ajax({
                type: "POST",
                url: "../../required/asn-data-check.php?trxid=<?php $link = $_GET['trxid']; echo $link;?>&session=<?php echo $_SESSION['alive'];?>",
                data: "",
                success: function(data){
                    if(data == "true")
                    {
                        window.location.replace("respons/sign?trxid=<?php echo $link;?>");    
                    }
                    else if(data == "false")
                    {
                        window.location.replace("sign?trxid=<?php echo $link;?>&error=legevelden");
                    }
                },                
                error: function(){
                    clearInterval(interval);
                }
        });
    }
    interval = setInterval(returnwasset, 500);
        
    </script>
